import React, { Component } from 'react'

class sam2 extends Component {
  constructor() {
    super()
    this.state = {
      title : 'Download the instagram videos free',
      description : 'this is used for download videos in instagram',
      URL : 'https://www.instagram.com'
    }
  }
  render() {
return (
    <div>
      <h2 className='app'>Hello {this.state.title}</h2>
    <h2>description : {this.state.description}</h2>
    <h2>url : <a href={this.state.URL}>open insta</a></h2>
    </div>
  )
}
}

export default sam2
